llColorHex(temp,temp,76))\n                }\n                data.color = col;\n            }\n            if(b === 5){ //Lengths\n                max = Math.max(...data.lengths)\n                for(i=0;i<len;++i) {\n                    temp =  Math.floor(255 * (1 - (data.lengths[i] / max)));\n                    col.push(fullColorHex(temp, temp, temp));\n                }\n                data.color = col;\n            }\n            if(b===6){ //GC\n                var temp = 0\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * data.gc[i]);\n                    col.push(fullColorHex(52, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            if(b===7){ //ECAI\n                var temp = 0\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * data.ecai[i]);\n                    col.push(fullColorHex(52, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            if(b===8){ //CAI\n                var temp = 0\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * data.cai[i]);\n                    col.push(fullColorHex(52, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            source.change.emit();\n            "},"id":"4a181785-6d66-401b-ad6d-9c90fba7378c","type":"CustomJS"},{"attributes":{"callback":null,"column_names":["ecai","lengths","similarity_scores","meanentropy","cai","color","doub","gc","x","y","clusters","nans","species"],"data":{"cai":{"__ndarray__":"fDwKzj4R4z9GQqYT17bkPydF51RLl+Y/O6ki4P+64D9avkJUd6jePwbpnH2mbOI/CjUEm9En3T9+xwuZq4/cPyoJ5O/qpeA/iY3JAV3B4j+e3kb88QPfP+G7sB2hs+I/6uGxKRjg4z+bZCA+7pngP7s3oNXYbN0/kB4iz/uX6D+osWmnSt/hP7TkMNj8eNw/sncS4IfN4D9A5k7/UV3gP77hF4rsw9w/05gCf0Kq4T9Wde2hCPDeP4ZfnPM9798/b6WkZ85f4T+Z0gll40HgP2wrXtBfcN8/bqN//xma4D98ZezX+DfhP3qvlcEHveA/Wh8GA5lD4T81wKddzHnfP8rVTXJva+A/yMLffONC4T/K1U1yb2vgP
